import React from "react";

export default function UnderConstructionBanner({ country }) {
  return (
    <div className="container">
      <div className="alert alert-warning" role="alert">
        <span>
          This page is still under construction. If you have ideas for what
          you'd like to see here, feel free to send them to{" "}
          <a href="mailto:info@geopoliti.ca">info@geopoliti.ca</a>.
        </span>
      </div>
    </div>
  );
}
